import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";

const pageStyle: React.CSSProperties = {
  background: "#f8fafc",
  minHeight: "100vh",
  padding: "0",
  fontFamily: "'Poppins', 'Inter', 'Roboto', Arial, sans-serif",
};

const headerStyle: React.CSSProperties = {
  margin: "32px 0 12px 0",
  fontWeight: 800,
  fontSize: "2.3rem",
  color: "#222",
  textAlign: "left",
  paddingLeft: "32px",
  letterSpacing: "0.01em",
  fontFamily: "'Poppins', sans-serif",
};

const welcomeStyle: React.CSSProperties = {
  fontSize: "1.1rem",
  color: "#888",
  paddingLeft: "32px",
  marginBottom: "10px",
  fontFamily: "'Inter', sans-serif",
};

const searchStyle: React.CSSProperties = {
  display: "flex",
  alignItems: "center",
  margin: "0 0 24px 0",
  paddingLeft: "32px",
};

const inputStyle: React.CSSProperties = {
  padding: "14px 22px",
  borderRadius: "18px",
  border: "1px solid #e0e0e0",
  fontSize: "1.05rem",
  width: "60%",
  background: "#f3f6fa",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
  boxShadow: "0 2px 8px rgba(0,0,0,0.03)",
};

const cardContainerStyle: React.CSSProperties = {
  display: "flex",
  flexWrap: "wrap",
  gap: "32px",
  padding: "32px",
  justifyContent: "flex-start",
};

const cardStyle: React.CSSProperties = {
  background: "#fff",
  borderRadius: "28px",
  boxShadow: "0 6px 32px rgba(0,0,0,0.07)",
  padding: "28px 24px",
  width: "320px",
  display: "flex",
  flexDirection: "column",
  alignItems: "flex-start",
  marginBottom: "32px",
  transition: "transform 0.18s cubic-bezier(.4,2,.6,1), box-shadow 0.18s",
  cursor: "pointer",
};

const imgStyle: React.CSSProperties = {
  width: "100%",
  height: "160px",
  objectFit: "cover",
  borderRadius: "18px",
  marginBottom: "18px",
  background: "#f6f6f6",
  border: "1px solid #eee",
};

const priceStyle: React.CSSProperties = {
  fontWeight: 700,
  fontSize: "1.2rem",
  color: "#fda085",
  margin: "12px 0 0 0",
  fontFamily: "'Inter', 'Segoe UI', Arial, sans-serif",
};

const titleStyle: React.CSSProperties = {
  fontWeight: 700,
  fontSize: "1.18rem",
  marginBottom: "6px",
  fontFamily: "'Poppins', sans-serif",
  color: "#222",
  textAlign: "left",
  maxWidth: "100%",
};

const descStyle: React.CSSProperties = {
  color: "#888",
  fontSize: "1.01rem",
  marginBottom: "14px",
  fontFamily: "'Inter', sans-serif",
  textAlign: "left",
  maxWidth: "100%",
  minHeight: "40px",
};

const infoRowStyle: React.CSSProperties = {
  display: "flex",
  justifyContent: "space-between",
  width: "100%",
  marginBottom: "8px",
  fontSize: "0.98rem",
  color: "#888",
  fontFamily: "'Inter', sans-serif",
};

const badgeStyle: React.CSSProperties = {
  background: "#f6d365",
  color: "#fff",
  borderRadius: "8px",
  padding: "4px 14px",
  fontWeight: 600,
  fontSize: "0.97rem",
  marginBottom: "8px",
  fontFamily: "'Poppins', sans-serif",
  letterSpacing: "0.03em",
};

const ListingPage: React.FC = () => {
  const [listings, setListings] = useState<any[]>([]);
  const [search, setSearch] = useState("");
  const location = useLocation();

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const dataParam = params.get("data");
    if (dataParam) {
      try {
        const parsed = JSON.parse(decodeURIComponent(dataParam));
        setListings(parsed);
      } catch (e) {
        setListings([]);
      }
    } else {
      setListings([]);
    }
  }, [location.search]);

  const filteredListings = listings.filter((item) => {
    const searchTermMatch =
      item.name?.toLowerCase().includes(search.toLowerCase()) ||
      item.title?.toLowerCase().includes(search.toLowerCase()) ||
      item.categoryDescription?.toLowerCase().includes(search.toLowerCase());
    return searchTermMatch;
  });

  return (
    <div style={pageStyle}>
      <div style={welcomeStyle}>Welcome. </div>
      <div style={headerStyle}>Find Your Dream Lights</div>
      <div style={searchStyle}>
        <input
          style={inputStyle}
          type="text"
          placeholder="Search based on location, name, or category"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
      </div>
      <div style={cardContainerStyle}>
        {filteredListings.map((item) => (
          <div key={item.id} style={cardStyle}>
            <img
              src={
                item.imageUrl && item.imageUrl !== "default.jpg"
                  ? item.imageUrl
                  : "https://img.icons8.com/ios-filled/200/light.png"
              }
              alt={item.name}
              style={imgStyle}
            />
            <div style={badgeStyle}>{item.categoryDescription || "Lighting"}</div>
            <div style={titleStyle}>{item.title || item.name}</div>
            <div style={descStyle}>{item.description}</div>
            <div style={infoRowStyle}>
              <span>Order Code: {item.orderCode}</span>
              <span>Qty: {item.quantity}</span>
            </div>
            <div style={priceStyle}>₹{item.price} INR</div>
            <button
              style={{
                background: "linear-gradient(90deg, #f6d365 0%, #fda085 100%)",
                color: "#fff",
                border: "none",
                borderRadius: "12px",
                padding: "12px 28px",
                cursor: "pointer",
                fontWeight: 700,
                fontSize: "1rem",
                marginTop: "auto",
                fontFamily: "'Poppins', 'Inter', Arial, sans-serif",
                alignSelf: "center",
                boxShadow: "0 2px 8px rgba(253,160,133,0.13)",
                transition: "background 0.2s",
              }}
            >
              Add to Cart
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ListingPage;
